
import { useState } from 'react';
import './CardContainer.css';
import Catagories from '../Catagories/Catagories';

const CardContainer = ({ addToFollow, searchQuery, onCardClick }) => {
    const [selectedCategory, setSelectedCategory] = useState('');

    const CardClick = (card) => {
        onCardClick(card);
    };




    const filteredCards = Cards.filter((card) => {
        const isMatchingName = card.name.toLowerCase().includes(searchQuery.toLowerCase());
        const isMatchingCategory = selectedCategory ? card.type === selectedCategory : true;
        return isMatchingName && isMatchingCategory;
    });

    const CategoryClick = (category) => {
        setSelectedCategory(category);
    };



    return (
        <div className="CardMain">
            <Catagories CategoryClick={CategoryClick} />


            <div className="CardContainer">



                {
                    filteredCards && filteredCards.length > 0 ? (


                        < div className="CardsContainer">
                            {
                                filteredCards.map((card, index) => (<div className="Card" key={card.id} onClick={() => CardClick(card)}  >
                                    <div className="CardImg" onClick={() => addToFollow(card)}>
                                        <img src={card.img} className='Image' alt="" />

                                    </div>
                                    <div className="CardText">
                                        <h4 className='Name'>{card.name}</h4>
                                        <p className='Text'>Price: {card.price}$</p>
                                        <p className='Text'> Type: {card.type}</p>


                                        <div className="CardButtons">
                                            <button className='like' onClick={() => addToFollow(card)} >
                                                <img className='LikeImage' src="data:image/png;base64," alt="" />
                                            </button>


                                        </div>

                                    </div>


                                </div>
                                ))
                            }
                        </div>
                    ) : (
                        <p className='NotFoundText'>No product found</p>
                    )


                }


            </div >
        </div>
    )
}
export default CardContainer;


